      <path d="M0 48h72V0z" fill="#00a3dd" />
      <path d="M0 48L72 0" stroke="#fcd116" strokeWidth={19} />
      <path d="M0 48L72 0" stroke="#000" strokeWidth={13} />
    </svg>
  </svg>
);

